updateFirst method not always saving the object<p><strong>updateFirst</strong> method of Spring Mongo Template is not always updating the mongo Db collection as expected.</p>

<p>(update request is fired by a save button in Front end ui , we see that a toast message appears saying table is successfully saved after save button is pressed and request is completed)</p>

<p>When few update requests are fired in sequential order one after another with no gap between updates, after few requests I can see that the data is no longer updated but there are no errors in logs. </p>

<p>Below is the method which updates the Database.</p>

<pre><code>@Override
public void updateTable(Source source, Table table) {
    log.debug("updating existing table " + table.getTableId() + " on source " + source.getSourceId());
    source.setStatus(SourceStatus.InProcess);
    Query q = query(where("_id").is(source.getId()).and("deleted").is(false).and("tables._id").is(table.getId()));
    Update u = update("tables.$", table);
    u.set("lastModifiedAt", source.getLastModifiedAt()).set("lastModifiedBy",
            source.getLastModifiedBy()).set("errorInObject", source.isErrorInObject()).set(
            "errorInChildObject", source.isErrorInChildObject()).set("errors", source.getErrors()).set(
            "failedFields", source.getFailedFields()).set("status",source.getStatus());
    template.updateFirst(q, u, Source.class);
}
</code></pre>

<p>I have logged queries fired to Mongo Db on spring boot application using properties file parameter and always update query that is being fired has proper values , but</p>

<p><strong>when update works</strong> -- There is a log message that says "Saving object to database" just before the update query is fired.</p>

<p><strong>when update does not work</strong> -- There is a log message that says "Saving object to database" just after the update query is fired , I think its writing to DB the previous update instead of current update.</p>

<p>MongoDB version -- 2.6.7</p>

<p>Spring Mongo Template Driver version -- 2.13.3</p>

<p>Spring Boot version -- v1.3.2.RELEASE</p>

<p>Can provide additional information if needed.</p>

