mongodb4.0 start a transaction in c# (drive rversion 2.7+), in the duration of transaction, the whole database will be locked, how to fix it?<p>(updated on 2019-7-2) 7 days after, finally, I solved this question. 
Well, my code is OK, WTF, wasted so  much time.
The question is my team use AliCloud(a chinese company, like Amazon, Azure), and the Mongodb has many versions, We created the DataBase a year ago, and that version, will lock the database while processing a trunsaction. </p>

<p>if you have some problem, hope my experence could help.</p>

<hr>

<p>forgive my poor english...</p>

<p>dev enviroment : 
mongodb4.0 cluster with 3nodes, support transactions.
.net core 2.2 (mongodb driver 2.7.2+)
Robot 3T(mongod tool)</p>

<p>the MongoDB database will be locked 60 seconds after starting a transaction, 
I thought maybe the problem is lock level, 
but I've already tried all enums of readconcern or writeconvern, nothing helps.</p>

<p>here is an image: now database is locked, I cannot query data in Robot 3T, neither my web app.</p>

<p>I mean, before commitTransaction/abortTransaction, the database will be locked. if the transcation is a big one, complete in 30s, actually the webapp cannot read data response to other visitors.</p>

