<p>I am trying to find new data uploaded to a database, this is the logic it follows:</p>

<p>Read data from my Mongo database store as <code>a</code> >> Pull new data from sql server, store as <code>b</code> >> filter the data and overwrite my Mongo database >> compare <code>a</code> and <code>b</code> to find new documents uploaded.</p>

<p>Here is the code I have so far:</p>

<pre><code>function comparer(otherArray){
  return function(current){
    return otherArray.filter(function(other){
      return other.value == current.value &amp;&amp; other.display == current.display
    }).length == 0;
  }
}

var onlyInA = a.filter(comparer(b));
var onlyInB = b.filter(comparer(a));

result = onlyInA.concat(onlyInB);

console.log(result);
</code></pre>

<p>I obtain <code>a</code> and <code>b</code> like so:</p>

<pre><code>a = await dbo.collection("master").find({ }, {projection:{_id: 0}}).toArray();

//upload all new data here, so b contains more objects than a

b = await dbo.collection("master").find({ }, {projection:{_id: 0}}).toArray();
</code></pre>

<p>I am expecting this to return all objects in <code>b</code> except if the objects exist in <code>a</code>, so I should see new data.</p>

<p>Here is a brief sample of my database;</p>

<pre><code>a = [{
            "Process": "Process1",
            "Num": "000000",
        }]

b = [{
            "Process": "Process1",
            "Num": "000000",
        },
        {
            "Process": "Process2",
            "Num": "000107",
        }]
</code></pre>

<p>Therefore <code>b</code> contains more objects, so finding the difference should show the object containing process 2. Thanks for any help!</p>

